import React from 'react';
import styled, { keyframes } from 'styled-components';

const Logo = ({ isCompact }) => {
  return (
    <LogoWrapper href="/" isCompact={isCompact}>
      <LogoIcon isCompact={isCompact}>âŠ™</LogoIcon>
      <LogoText isCompact={isCompact}>AIOLOS<span>labs</span></LogoText>
    </LogoWrapper>
  );
};

const pulse = keyframes`
  0% {
    transform: scale(1);
  }
  50% {
    transform: scale(1.05);
  }
  100% {
    transform: scale(1);
  }
`;

const LogoWrapper = styled.a`
  display: flex;
  align-items: center;
  gap: ${props => props.isCompact ? '8px' : '10px'};
  text-decoration: none;
  transition: all 0.3s ease;

  &:hover {
    transform: translateY(-2px);

    & > div:first-child {
      animation: ${pulse} 0.6s ease-in-out;
    }
  }
`;

const LogoIcon = styled.div`
  font-size: ${props => props.isCompact ? '1.6rem' : '1.8rem'};
  background: linear-gradient(90deg, #39B8B8, #00A4C0);
  -webkit-background-clip: text;
  -webkit-text-fill-color: transparent;
  background-clip: text;
  transition: all 0.3s ease;
`;

const LogoText = styled.div`
  font-size: ${props => props.isCompact ? '1.3rem' : '1.5rem'};
  font-weight: 700;
  letter-spacing: 1px;
  color: #1a1a2e;
  transition: all 0.3s ease;

  span {
    font-size: ${props => props.isCompact ? '0.8rem' : '0.9rem'};
    font-weight: 400;
    opacity: 0.7;
    margin-left: 3px;
    color: #39B8B8;
    transition: all 0.3s ease;
  }
`;

export default Logo;
